import React from 'react';

import { DeleteOutlined,SearchOutlined,ReloadOutlined} from '@ant-design/icons';

import './index.css';

import { Table, Button } from 'antd';

function TabelaPedidos({dataSource,acoes}) {



    const columns = [
        {
            title: 'Nº',
            dataIndex: 'numero',
            key: 'numero',

        },
        {
            title: 'Cliente',
            dataIndex: 'cliente',
            key: 'cliente',
        },
        {
            title: 'Data',
            dataIndex: 'data',
            key: 'data',
        },
        {
            title: 'Ações',
            dataIndex: 'acoes',
            key: 'acoes',
            render: _ => (
                <span>
                    <Button
                        type='primary'
                        style={{ marginLeft: '2px' }}
                        icon={<SearchOutlined />}
                        title='Ver Pedido'
                    />
                    <Button
                        type='primary'
                        style={{ marginLeft: '2px' }}
                        danger
                        title='Apagar Pedido'
                        icon={<DeleteOutlined />} 
                        />
                    <Button
                        type='primary'
                        style={{ marginLeft: '2px' }}
                        success
                        title='Repetir Pedido'
                        icon={ <ReloadOutlined />} 
                        />
                </span>
            ),
        },
    ];



    return (  
        <Table dataSource={dataSource} columns={columns} className='Tabela' />   
    );
}

export default TabelaPedidos;
